import React from 'react';
import ReactDOM from 'react-dom';
import { Header, Footer } from './components/Nav.js';
import './css/main.css'

function Main () {
    return (
        <div class="content">
            <h1>custom designs</h1>
            <div class="image-gallery">
                <img src={require("./images/nadia.jpg")}/>
            </div>
            <div class="custom-design">
                <h1>how it works</h1>
            </div>
        </div>
    )
}

 function App () {
    return (
        <div class="container">
            <Header />
            <Main />
        </div>
    );
}

ReactDOM.render ( [<App key="1"/> , <Footer key="2" />], document.getElementById("root") )
